import React from "react";
// nodejs library to set properties for components
import PropTypes from "prop-types";

// @material-ui/core components
import withStyles from "@material-ui/core/styles/withStyles";
import LinearProgress from "@material-ui/core/LinearProgress";
// core components
import customLinearProgressStyle from "assets/jss/material-kit-react/components/customLinearProgressStyle.jsx";

const CustomLinearProgress = ({ ...props }) => {
  const { classes, color, skill , ...rest } = props;
  const skillComponent = <h6 className={classes.cardTitle}>{skill}</h6>;
  return (
    <LinearProgress
      {...rest}
      classes={{
        root: classes.root + " " + classes[color + "Background"],
        bar: classes.bar + " " + classes[color]
      }}
    >
    skillComponent
    </LinearProgress>
  );
}

CustomLinearProgress.defaultProps = {
  color: "gray"
};

CustomLinearProgress.propTypes = {
  classes: PropTypes.object.isRequired,
  color: PropTypes.oneOf([
    "primary",
    "warning",
    "danger",
    "success",
    "info",
    "rose",
    "gray"
  ]),
  skill: PropTypes.string
};

export default withStyles(customLinearProgressStyle)(CustomLinearProgress);
